  was determined by geocoding either the low, high, or mid value for each ZIP+4u00c2u00ae
  address range. All attribute data is drawn from the USPSu00c2u00ae (United States
  Postal Serviceu00c2u00ae) ZIP+4u00c2u00ae product - see also supplementary information
